import style from './mystyle.module.css';
import {Grid, Row, Col} from 'react-bootstrap';

function App(){
  return (
      <div style={{width: '700px'}}>
        <div style={{border: '3px solid gray'}}>
          <div style={{}}>Perofessional Experiences</div>
        </div>
        <div className="row">
          <div className="col-md-4">
            <ProfileCard professionalExperience="Web Developer"/>
          </div>
          <div className="col-md-4">
            <ProfileCard professionalExperience="Data Analysis"/>
          </div>
          <div className="col-md-4">
            <ProfileCard professionalExperience="Librarian"/>
          </div>
        </div>


      </div>
  );
}

export default App;
